import React, { Component } from "react";
import { TextField, Container, Button, IconButton } from "@material-ui/core";
import "../containers/LoginOrRegister.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEyeSlash, faEye } from "@fortawesome/free-solid-svg-icons";

class Login extends Component {
  state = {
    isShowPassword: false,
    email: "",
    password: ""
  };
  render() {
    return (
      <div
        className="container"
        style={{ height: window.document.height - 100 }}
      >
        <h3>LOGIN</h3>
        <Container>
          <TextField
            className="textFieldStyle"
            label="Email"
            margin="dense"
            variant="filled"
            value={this.state.email}
            onChange={event => this.setState({ email: event.target.value })}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Passworld"
            margin="dense"
            variant="filled"
            value={this.state.password}
            onChange={event => this.setState({ password: event.target.value })}
            type={this.state.isShowPassword ? "email" : "password"}
            color="white"
            InputProps={{
              endAdornment: (
                <IconButton
                  onClick={() => {
                    this.setState({
                      isShowPassword: !this.state.isShowPassword
                    });
                  }}
                >
                  <FontAwesomeIcon
                    icon={this.state.isShowPassword ? faEye : faEyeSlash}
                  />
                </IconButton>
              )
            }}
          />
          <br />
          <Button
            className="buttonStyle"
            onClick={() => {
              console.log("AA");
            }}
            style={{
              width: 500,
              marginTop: 50,
              background: "green",
              color: "white"
            }}
          >
            LOGIN
          </Button>
        </Container>
      </div>
    );
  }
}

export default Login;
